import React from 'react'

export default class extends React.Component {
    render() {
        return (
            <div>
                <div className="container">
                    <img src=" /platzi-logo.png" alt="" />
                <div className="container-text">
                    <h1>Created by Zunirry</h1>
                    <p>A course with Next.js</p>
                </div>

                </div>
                <style jsx >{`
                    :global(body) {
                    background: #1A2A35;
                    }
                    
                    h1{
                        color: #cccc;
                    }
                    p{
                        color: #cccc;
                    }

                    .container{
                        display: flex;
                        justify-content: center;
                    }

                    .container img{
                        width: 200px;
                    }

                    .container text{
                        border: 1px solid red;
                    }
                `}</style>

                
            </div>
        )
    }
}
